"use strict";(self.webpackChunkdocs_hasil_karya=self.webpackChunkdocs_hasil_karya||[]).push([[877],{2614:a=>{a.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Apa Itu Sistem Manajemen Proyek (SiMonRo)","href":"/docs/intro","docId":"intro","unlisted":false},{"type":"link","label":"Apa Itu Early Warning System (EWS)","href":"/docs/intro-ews","docId":"intro-ews","unlisted":false},{"type":"category","label":"Petunjuk Penggunaan Sistem Management Proyek","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Pengisian Data","href":"/docs/petunjuk-penggunaan-simonro/pengisian-data","docId":"petunjuk-penggunaan-simonro/pengisian-data","unlisted":false},{"type":"link","label":"Pencatatan Perpindahan Material","href":"/docs/petunjuk-penggunaan-simonro/pencatatan-perpindahan-material","docId":"petunjuk-penggunaan-simonro/pencatatan-perpindahan-material","unlisted":false},{"type":"link","label":"Pencatatan BBM Kendaraan","href":"/docs/petunjuk-penggunaan-simonro/pencatatan-bbm-kendaraan","docId":"petunjuk-penggunaan-simonro/pencatatan-bbm-kendaraan","unlisted":false},{"type":"link","label":"Pencatatan Rental Kendaraan","href":"/docs/petunjuk-penggunaan-simonro/pencatatan-rental-kendaraan","docId":"petunjuk-penggunaan-simonro/pencatatan-rental-kendaraan","unlisted":false}],"href":"/docs/category/petunjuk-penggunaan-sistem-management-proyek"},{"type":"category","label":"Petunjuk Penggunaan Early Warning System (EWS)","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Dashboard","href":"/docs/petunjuk-penggunaan-ews/dashboard","docId":"petunjuk-penggunaan-ews/dashboard","unlisted":false},{"type":"link","label":"Dashboard Map","href":"/docs/petunjuk-penggunaan-ews/dashboard-map","docId":"petunjuk-penggunaan-ews/dashboard-map","unlisted":false},{"type":"link","label":"EWS Device","href":"/docs/petunjuk-penggunaan-ews/ews-device","docId":"petunjuk-penggunaan-ews/ews-device","unlisted":false},{"type":"link","label":"Client","href":"/docs/petunjuk-penggunaan-ews/client","docId":"petunjuk-penggunaan-ews/client","unlisted":false},{"type":"link","label":"Log Data Ews Device","href":"/docs/petunjuk-penggunaan-ews/log-data-ews-device","docId":"petunjuk-penggunaan-ews/log-data-ews-device","unlisted":false}],"href":"/docs/category/petunjuk-penggunaan-early-warning-system-ews"},{"type":"category","label":"Petunjuk Penggunaan EWS Pada Client","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Penggunaan EWS Sebagai Client","href":"/docs/petunjuk-penggunaan-ews-client/penggunaan-sebagai-client","docId":"petunjuk-penggunaan-ews-client/penggunaan-sebagai-client","unlisted":false}],"href":"/docs/category/petunjuk-penggunaan-ews-pada-client"}]},"docs":{"intro":{"id":"intro","title":"Apa Itu Sistem Manajemen Proyek (SiMonRo)","description":"SiMonRo merupakan sistem yang dirancang untuk mengelola data proyek. Dengan memastikan bahwa proyek dapat berjalan dengan lancar dan efisien, serta meminimalkan risiko terkait manajemen data untuk meningkatkan transparansi.","sidebar":"tutorialSidebar"},"intro-ews":{"id":"intro-ews","title":"Apa Itu Early Warning System (EWS)","description":"Early Warning System (EWS) merupakah sebuah website yang bertujuan untuk melakukan pemantauan bencana gempa bumi pada suatu proyek, website ini bertujuan untuk meminimalisir resiko terjadinya kerugian yang besar, dengan adanya pemantauan data secara realtime maka kita bisa melakukan evakuasi lebih cepat","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-ews-client/penggunaan-sebagai-client":{"id":"petunjuk-penggunaan-ews-client/penggunaan-sebagai-client","title":"Penggunaan EWS Sebagai Client","description":"Penggunaan Early Warning System (EWS) pada client dapat dilakukan saat client menerima email dari hasilkarya.co.id yang berisi informasi akun yang telah dibuat oleh admin. Client mengandalkan satu perangkat EWS untuk mengakses dan mengelola semua data yang diterimanya. Dengan demikian, fitur-fitur yang tersedia dalam perangkat tersebut terfokus pada menampilkan data dari satu sumber EWS device yang dimiliki oleh client. Dengan penggunaan yang terfokus ini, client dapat dengan mudah mengakses dan merespons informasi yang diberikan oleh ews.hasilkarya.co.id mengenai perangkatnya ataupun informasi adanya gempa.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-ews/client":{"id":"petunjuk-penggunaan-ews/client","title":"Client","description":"Fitur \\"Client\\" menampilkan seluruh data secara detail tentang client, dan diidentifikasi oleh kode identitas unik yang berbeda untuk setiap client.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-ews/dashboard":{"id":"petunjuk-penggunaan-ews/dashboard","title":"Dashboard","description":"Fitur \\"Dashboard\\" memberikan kemudahan pengguna untuk memilih perangkat dan melihat perkembangan data secara real-time dengan memperlihatkan grafik detail getaran dan total peralatan yang dimiliki.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-ews/dashboard-map":{"id":"petunjuk-penggunaan-ews/dashboard-map","title":"Dashboard Map","description":"Fitur \\"Dashboard Map\\" memberikan kemudahan pengguna untuk melihat perkembangan data secara real-time dalam bentuk peta, sesuai dengan seluruh koordinat perangkat yang terdaftar. Penjelasan lebih lanjut tentang klasifikasi gempa berdasarkan magnitudo dan waktu kejadiannya adalah sebagai berikut:","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-ews/ews-device":{"id":"petunjuk-penggunaan-ews/ews-device","title":"EWS Device","description":"Fitur \\"EWS Device\\" merupakan antarmuka yang menampilkan keseluruhan data dari setiap perangkat EWS (Early Warning System), yang memiliki identitas kode unik untuk setiap perangkat dan dilengkapi dengan spesifikasi yang komprehensif.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-ews/log-data-ews-device":{"id":"petunjuk-penggunaan-ews/log-data-ews-device","title":"Log Data Ews Device","description":"Fitur \\"Log Data Ews Device\\" untuk memeriksa seluruh data log pengukuran berdasarkan perangkat dan tanggal yang dipilih pada log EWS Device dengan standar tampilan defaultnya rentang satu bulan.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-simonro/pencatatan-bbm-kendaraan":{"id":"petunjuk-penggunaan-simonro/pencatatan-bbm-kendaraan","title":"Pencatatan BBM Kendaraan","description":"Fitur \\"Pencatatan Bahan Bakar Minyak Kendaraan\\" memberikan kemudahan bagi proyek untuk mencatat penggunaan bahan bakar dengan tujuan meningkatkan transparansi. Fitur ini telah diintegrasikan dengan flowmeter yang menghasilkan QR Code mencakup volume bahan bakar yang telah digunakan.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-simonro/pencatatan-perpindahan-material":{"id":"petunjuk-penggunaan-simonro/pencatatan-perpindahan-material","title":"Pencatatan Perpindahan Material","description":"Fitur \\"Pencatatan Perpindahan Material\\" memberikan kemudahan bagi proyek untuk mencatat pergerakan material dari tambang ke lokasi proyek, dengan tujuan menjaga keamanan dan keakuratan data.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-simonro/pencatatan-rental-kendaraan":{"id":"petunjuk-penggunaan-simonro/pencatatan-rental-kendaraan","title":"Pencatatan Rental Kendaraan","description":"Fitur \\"Pencatatan Rental Kendaraan\\" memberikan kemudahan bagi proyek untuk mencatat dan memantau penggunaan rental kendaraan, menjaga transparansi data dan memastikan pembayaran tepat waktu.","sidebar":"tutorialSidebar"},"petunjuk-penggunaan-simonro/pengisian-data":{"id":"petunjuk-penggunaan-simonro/pengisian-data","title":"Pengisian Data","description":"Fitur \\"Master Data\\" memberikan kemudahan bagi proyek untuk menambahkan dan mengelola data-data utama, seperti penerima notifikasi, pelanggan, vendor, material, POS, dan proyek. Dengan adanya fitur ini, proyek dapat meningkatkan efisiensi dalam pengelolaan data, dan memastikan keakuratan informasi.","sidebar":"tutorialSidebar"}}}}')}}]);